import React from 'react';
import styled, { keyframes } from 'styled-components';
import { theme } from '../../styles/theme';

interface TimelineItemProps {
  year: string;
  title: string;
  company: string;
  location: string;
  index: number;
  isActive: boolean;
  onClick: () => void;
}

interface TimelineProps {
  items: Array<{
    period: string;
    title: string;
    company: string;
    location: string;
  }>;
  activeIndex: number;
  setActiveIndex: (index: number) => void;
}

const pulse = keyframes`
  0% { opacity: 0.5; }
  50% { opacity: 0.8; }
  100% { opacity: 0.5; }
`;

const TimelineContainer = styled.div`
  position: relative;
  display: flex;
  flex-direction: column;
  padding-left: 30px;

  /* Timeline vertical line */
  &::before {
    content: '';
    position: absolute;
    top: 0;
    bottom: 0;
    left: 12px;
    width: 2px;
    background: ${theme.colors.glassBorder};
    z-index: 0;
  }

  @media (max-width: ${theme.breakpoints.md}) {
    padding-left: 24px;

    &::before {
      left: 8px;
    }
  }
`;

const TimelineItemContainer = styled.div<{isActive: boolean; index: number}>`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  padding: ${theme.spacing.md} ${theme.spacing.lg};
  border-radius: ${theme.borderRadius.lg};
  margin-bottom: ${theme.spacing.xl};
  cursor: pointer;
  transition: transform 0.2s ease, background-color 0.2s ease;
  position: relative;
  background: ${props => props.isActive ? theme.colors.glass : 'transparent'};
  transform: translateX(${props => props.isActive ? '5px' : '0'});
  backdrop-filter: ${props => props.isActive ? 'blur(10px)' : 'none'};
  border: 1px solid ${props => props.isActive ? theme.colors.glassBorder : 'transparent'};
  opacity: ${props => props.isActive ? 1 : 0.8};

  &:hover {
    opacity: 1;
    transform: translateX(5px);
    background: ${theme.colors.glass};
    border-color: ${theme.colors.glassBorder};
  }

  /* Timeline node */
  &::before {
    content: '';
    position: absolute;
    left: -30px;
    top: 24px;
    width: 24px;
    height: 24px;
    border-radius: 50%;
    background: ${props => props.isActive ? theme.colors.primary : theme.colors.background};
    border: 2px solid ${props => props.isActive ? theme.colors.primary : theme.colors.glassBorder};
    z-index: 1;
    transition: all 0.2s ease;

    @media (max-width: ${theme.breakpoints.md}) {
      left: -24px;
      width: 18px;
      height: 18px;
    }
  }

  /* Timeline pulse effect - simplified and only for active state */
  &::after {
    content: '';
    position: absolute;
    left: -30px;
    top: 24px;
    width: 24px;
    height: 24px;
    border-radius: 50%;
    background: transparent;
    border: 2px solid ${props => props.isActive ? theme.colors.primary : 'transparent'};
    opacity: ${props => props.isActive ? 0.6 : 0};
    transform: scale(1.5);
    z-index: 0;

    @media (max-width: ${theme.breakpoints.md}) {
      left: -24px;
      width: 18px;
      height: 18px;
    }
  }
`;

const YearTag = styled.span<{isActive: boolean}>`
  font-family: 'Fira Code', monospace;
  font-size: ${theme.typography.sizes.caption};
  color: ${props => props.isActive ? theme.colors.primary : theme.colors.textSecondary};
  background: ${props => props.isActive 
    ? 'rgba(74, 157, 255, 0.15)' 
    : 'rgba(255, 255, 255, 0.05)'};
  padding: 4px 8px;
  border-radius: ${theme.borderRadius.sm};
  margin-bottom: ${theme.spacing.sm};
`;

const JobTitle = styled.h3<{isActive: boolean}>`
  margin: 0;
  font-size: ${theme.typography.sizes.body};
  font-weight: ${theme.typography.fontWeights.semibold};
  color: ${props => props.isActive ? theme.colors.text : theme.colors.textSecondary};
`;

const CompanyName = styled.span<{isActive: boolean}>`
  font-size: ${theme.typography.sizes.body};
  color: ${props => props.isActive ? theme.colors.secondary : theme.colors.textSecondary};
  margin-top: ${theme.spacing.xs};
  display: block;
`;

const Location = styled.span`
  font-size: ${theme.typography.sizes.caption};
  color: ${theme.colors.textSecondary};
  margin-top: ${theme.spacing.xs};
`;

// Blinking cursor animation like in a code editor
const Cursor = styled.div<{isActive: boolean}>`
  display: ${props => props.isActive ? 'block' : 'none'};
  width: 2px;
  height: 16px;
  background-color: ${theme.colors.primary};
  margin-left: ${theme.spacing.sm};
  animation: ${pulse} 1.3s infinite;
`;

const TimelineItem: React.FC<TimelineItemProps> = ({ 
  year, 
  title, 
  company, 
  location, 
  index, 
  isActive, 
  onClick 
}) => {
  return (
    <TimelineItemContainer 
      isActive={isActive} 
      index={index} 
      onClick={onClick}
      role="button"
      aria-pressed={isActive}
    >
      <YearTag isActive={isActive}>{year}</YearTag>
      <JobTitle isActive={isActive}>
        {title}
      </JobTitle>
      <CompanyName isActive={isActive}>@{company}</CompanyName>
      <Location>{location}</Location>
    </TimelineItemContainer>
  );
};

const Timeline: React.FC<TimelineProps> = ({ items, activeIndex, setActiveIndex }) => {
  return (
    <TimelineContainer>
      {items.map((item, index) => (
        <TimelineItem
          key={index}
          year={item.period.split(' - ')[0]} // Just take the start year
          title={item.title}
          company={item.company}
          location={item.location}
          index={index}
          isActive={index === activeIndex}
          onClick={() => setActiveIndex(index)}
        />
      ))}
    </TimelineContainer>
  );
};

export default Timeline;
